import MyBio from './components/Story/story';
import Test from './components/Test/test';
import NavBar from './components/Nav/nav';
import RenderWalk from './components/Parks and weather/parks';
import Game from './components/game/game';

/*
<NavBar />
<MyBio className='bio' />
<Coolchart className='chart' />
<Test className='form'/>
<RenderWalk /> 
<Game />  
*/

function App() {
  return (
    <div className='app'
>

<NavBar />
<MyBio id="bio" className='bio' />
<Coolchart id="chart" className='chart' />
<Test id="test" className='form'/>
<RenderWalk id="walk" /> 
<Game id="game" /> 

    </div>
  );
}

export default App;
